bool isOK(int x)
{
	int t=x;
	int s=0;
	while(t)
	{
		s+=t%10;
		t/=10;
	}
	return x%s==0;
}

int slove(int x)
{
	int res=0;
	int ptr=x/100000;
	res+=sum[ptr];
	for(int i=x;i%100000!=0;i--)
	{
		res+=isOK(i);
	}
	return res;
}


int main()
{
	freopen("input.txt","r",stdin);
	int T,a,b,cas=1;
	input(T);
	for(int i=1;i<=10000;i++)
	{
		sum[i]+=sum[i-1];
	}

	while(T--)
	{
		scanf("%d%d",&a,&b);
		printf("Case %d: ",cas++);
		print(slove(b)-slove(a-1));
	}
	return 0;
}


